import { v4 as uuidv4 } from 'uuid';

const initialProgramId = uuidv4();
const initialWorkoutId = uuidv4();
const initialExerciseId = uuidv4();
const initialSetId = uuidv4();

export const initialState = {
  programs: {
    [initialProgramId]: {
      user_id: 2,
      id: initialProgramId,
      name: 'Program 1',
      program_duration: 0,
      duration_unit: 'Days',
      days_per_week: 0,
      main_goal: 'Strength',
      workouts: {
        [initialWorkoutId]: {
          id: initialWorkoutId,
          name: 'Workout 1',
          order: 1,
          exercises: [
            {
              id: initialExerciseId,
              name: 'Bench Press',
              muscle: 'Chest',
              equipment: 'Barbell',
              catalog_exercise_id: 'cat-001',
              order: 1,
              isNew: false,
              sets: [
                {
                  id: initialSetId,
                  reps: 8,
                  weight: 135,
                  order: 1,
                  isNew: false
                }
              ]
            }
          ],
          isNew: false
        }
      },
      isNew: false
    }
  },
  activeWorkout: initialWorkoutId,
  selectedProgram: initialProgramId
};
